import React, { Component } from 'react';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';

class PersonList extends Component {
    state = {
        persons: [],
        selectedPerson: null, // To store the details of the selected person
    };

    componentDidMount() {
        axios.get(`https://randomuser.me/api/?results=10`)
            .then(res => {
                const persons = res.data.results;
                this.setState({ persons });
            });
    }

    // Open the modal with selected person details
    handleDetailsClick = (person) => {
        this.setState({ selectedPerson: person });
    };

    // Close the modal
    closeDetailsModal = () => {
        this.setState({ selectedPerson: null });
    };

    render() {
        const { persons, selectedPerson } = this.state;

        return (
            <div>
                {/* Header */}
                <div style={{ backgroundColor: '#28a745', padding: '20px' }}>
                    <h1 className="text-center text-white">User List</h1>
                </div>

                {/* Content */}
                <div className="container my-4" style={{ backgroundColor: 'white', padding: '20px', borderRadius: '8px' }}>
                    {persons.map(person => (
                        <div
                            key={person.login.uuid}
                            className="card mb-4"
                            style={{ backgroundColor: '#17a2b8', color: 'white' }}
                        >
                            <div className="row g-0">
                                {/* Profile Picture */}
                                <div className="col-md-3 text-center p-3">
                                    <img
                                        src={person.picture.large}
                                        alt={`${person.name.first}`}
                                        className="rounded-circle img-fluid mb-2"
                                    />
                                    <button
                                        className="btn btn-primary"
                                        onClick={() => this.handleDetailsClick(person)}
                                    >
                                        Details
                                    </button>
                                </div>

                                {/* User Name */}
                                <div className="col-md-9">
                                    <div className="card-body">
                                        <h5 className="card-title">{`${person.name.title} ${person.name.first} ${person.name.last}`}</h5>
                                    </div>
                                </div>
                            </div>
                        </div>
                    ))}

                    {/* Modal for Details */}
                    {selectedPerson && (
                        <div
                            className="modal show"
                            style={{
                                display: 'block',
                                backgroundColor: 'rgba(0, 0, 0, 0.5)',
                                zIndex: 1050,
                            }}
                        >
                            <div className="modal-dialog">
                                <div className="modal-content">
                                    <div className="modal-header">
                                        <h5 className="modal-title">{`${selectedPerson.name.title} ${selectedPerson.name.first} ${selectedPerson.name.last}`}</h5>
                                        <button
                                            type="button"
                                            className="btn-close"
                                            onClick={this.closeDetailsModal}
                                        ></button>
                                    </div>
                                    <div className="modal-body">
                                        <p>
                                            <strong>User Name:</strong> {selectedPerson.login.username}<br />
                                            <strong>Gender:</strong> {selectedPerson.gender.toUpperCase()}<br />
                                            <strong>Time Zone Description:</strong> {selectedPerson.location.timezone.description}<br />
                                            <strong>Address:</strong> {`${selectedPerson.location.street.number} ${selectedPerson.location.street.name}, ${selectedPerson.location.city}, ${selectedPerson.location.state}, ${selectedPerson.location.country} - ${selectedPerson.location.postcode}`}<br />
                                            <strong>Email:</strong> {selectedPerson.email}<br />
                                            <strong>Birth Date and Age:</strong> {`${selectedPerson.dob.date.substring(0, 10)} (${selectedPerson.dob.age})`}<br />
                                            <strong>Register Date:</strong> {selectedPerson.registered.date.substring(0, 10)}<br />
                                            <strong>Phone:</strong> {selectedPerson.phone}<br />
                                            <strong>Cell:</strong> {selectedPerson.cell}
                                        </p>
                                    </div>
                                    <div className="modal-footer">
                                        <button
                                            className="btn btn-secondary"
                                            onClick={this.closeDetailsModal}
                                        >
                                            Close
                                        </button>
                                    </div>
                                </div>
                            </div>
                        </div>
                    )}
                </div>
            </div>
        );
    }
}

export default PersonList;
